import React, { Component } from 'react'
import villiansData from '../src/data/joker.json'

const names = villiansData.results[0].names
const abilities = names.filter(name => name.intelligence === '100')


class Villians extends Component {
    render() {
        return (
            <div>
                <h1>{name.length} Villians</h1>
                <h2>Strengths: {abilities.length}</h2>
            </div>

        )

    }



}

export default Villians
